        getQuantInfo: function getQuantInfo(action, quant){
            var i = 0, resQuantBlock = '', messageQuant = '', numberActivePr = 0;

            if(quant >= 1 && quant < 6){
                numberActivePr = 1;
                messageQuant = ' ';
            }else if(quant >= 6 && quant < 21){
                numberActivePr = 2;
                messageQuant = '';
            }else if(quant >= 21 && quant < 51){
                numberActivePr = 3;
                messageQuant = '';
            }else if(quant >= 51 && quant < 101){
                numberActivePr = 4;
                messageQuant = '';
            }else if(quant >= 101){
                numberActivePr = 5;
                messageQuant = ' ';
            }else{
                messageQuant = '  ';
            }

            resQuantBlock =
                BX.create('div', {
                    attrs: {
                        className: 'product-item-detail-quantity-val'
                    },
                    children:[
                        BX.create('div', {
                            attrs: {
                                className: 'own-progress'
                            }
                        }),
                        BX.create('span', {
                            text: messageQuant
                        })
                    ]
                });

                for(i = 1; i <= 5; i++){
                    if(numberActivePr >= i)
                        $(resQuantBlock).find('.own-progress')[0].appendChild(
                            BX.create('div', {
                                attrs: {
                                    className: 'own-pr active'
                                },
                                children:[
                                    BX.create('span')
                                ]
                            })
                        );
                    else
                        $(resQuantBlock).find('.own-progress')[0].appendChild(
                            BX.create('div', {
                                attrs: {
                                    className: 'own-pr'
                                },
                                children:[
                                    BX.create('span')
                                ]
                            })
                        );
                }
            return resQuantBlock;
        },
